import { Box, MenuItem, List, ListItem, ListItemText, Divider, Select, InputLabel, FormControl } from '@mui/material'
import { styled } from '@mui/material/styles';

const DeskFooter = ({selectCountry,selected, arrAyuda, arrEmpresa, arrPoliticas,arrUnete,onChange}) => {

  const StyledList = styled(List)(()=>({
    '&:first-child ': {
        textTransform: 'uppercase',
        typography: { fontWeight: '600' }
      }
 
  }))

  return (
    <Box sx={{ margin: '72px 0' }}>
      <Divider />
      <Box component='footer' sx={{ display: 'flex', flexFlow: 'row nowrap', justifyContent: 'space-around', marginTop: '24px' }}>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120, marging: '0', '&>.MuiInputBase-root': { marginTop: 0 } }}>
          <InputLabel id="country-label" sx={{
            padding: '0', transformOrigin: 'bottom',
            lineHeight: '1.6rem', textTransform: 'uppercase'
          }}></InputLabel>
          <Select
            labelId="country-label"
            id="demo-simple-select-standard"
            value={selected}
            label="country-label"
            onChange={(e) => { e.preventDefault();onChange(e.target.value)}} 
          >
            {selectCountry.map((country) => {
              return <MenuItem value={country} sx={{ textTransform: 'uppercase' }}>{country}</MenuItem>
            })}



          </Select>
        </FormControl>
        <StyledList>
          <ListItem>
            <ListItemText disableTypography>{arrAyuda[0]}</ListItemText>
          </ListItem>
        </StyledList>

        <List sx={{
          '& > :first-child': {
            textTransform: 'uppercase',
            typography: { fontWeight: '600' }
          }
        }}>
          <ListItem>
            <ListItemText disableTypography>{arrEmpresa[0]}</ListItemText>
          </ListItem>
          <ListItem>
            <ListItemText disableTypography>{arrEmpresa[1]}</ListItemText>
          </ListItem>
        </List>

        <List sx={{
          '& > :first-child': {
            textTransform: 'uppercase',
            typography: { fontWeight: '600' }
          }
        }}>
          <ListItem>
            <ListItemText disableTypography>{arrPoliticas[0]} </ListItemText>
          </ListItem>
          <ListItem>
            <ListItemText disableTypography>{arrPoliticas[1]}</ListItemText>
          </ListItem>
        </List>
        <List sx={{
          '& > :first-child': {
            textTransform: 'uppercase',
            typography: { fontWeight: '600' }
          }
        }}>
          <ListItem>
            <ListItemText disableTypography>{arrUnete[0]} </ListItemText>
          </ListItem>
          <ListItem>
            <ListItemText disableTypography>{arrUnete[1]}</ListItemText>
          </ListItem>
        </List>
        <span>algo a la derecha</span>
      </Box>
    </Box>
  )
}

export default DeskFooter
